#Title of Assignment"PyPoll Homework Solution"#Import dependenciesimport osimport csv#Load CSV filefile_to_load = os.path.join("Resources", "election_data.csv")#Initialize variablestotal_votes = 0khan_votes = 0correy_votes = 0li_votes = 0otooley_votes = 0#Open CSVwith open(file_to_load, newline="") as csvfile:    csvreader = csv.reader(csvfile, delimiter=",")    csv_header = next(csvreader)    #Cycle through rows of data    for row in csvreader:                #Update total vote count        total_votes += 1                #Update candidate count based on vote        if row[2] == "Khan":            khan_votes += 1                    elif row[2] == "Correy":            correy_votes += 1                    elif row[2] == "Li":            li_votes += 1                    elif row[2] == "O'Tooley":            otooley_votes += 1#Print resultsprint("Election Results")